public class MinimumCostPath {

	static int[][] min;
	static Date start;

	final static int up = 0;
	final static int left = 1;
	final static int right = 2;
	final static int down = 3;

	final static Path[] list = new Path[100000];
	static int addPontier = 0;
	static int removePointer = 0;

	public static void main(String[] args) {
		BufferedReader reader = new BufferedReader(new InputStreamReader(System.in));
		String tString = "";
		try {
			tString = reader.readLine();
		} catch (IOException e) {
		}

		int T = Integer.parseInt(tString);

		for (int i = 0; i < T; i++) {

			String nString = "";
			try {
				nString = reader.readLine();
			} catch (IOException e) {
			}

			int N = Integer.parseInt(nString);

			int[][] m = new int[N][N];

			String[] values = null;
			try {
				values = reader.readLine().trim().split(" ");
			} catch (IOException e) {
			}

			start = new Date();

			fillMatrix(values, m);

			System.out.println("setup time 1: " + (new Date().getTime() - start.getTime()));

			min = new int[N][N];

			for (int j = 0; j < min.length; j++) {
				for (int k = 0; k < min[j].length; k++) {
					min[j][k] = -1;
				}
			}

			min[0][0] = m[0][0];

			addPontier = 0;
			removePointer = 0;

			int[] sPos = new int[] { 0, 0 };

			int[] dPos = new int[] { N - 1, N - 1 };

			Path fPath = new Path();

			fPath.addStep(sPos, m);

			if (sPos[0] != dPos[0] || sPos[1] != dPos[1]) {
				list[addPontier] = fPath;
				addPontier++;
			}

			System.out.println("setup time 2: " + (new Date().getTime() - start.getTime()));

			while (removePointer != addPontier) {

				if (removePointer == list.length) {
					removePointer = 0;
				}

				Path cPath = list[removePointer];
				removePointer++;

				if (cPath.currentPos[1] < m.length - 1 && cPath.currentPos[1] > 0) {
					move(cPath, m, dPos, up);
				}
				if (cPath.currentPos[0] < m.length - 1 && cPath.currentPos[0] > 0) {
					move(cPath, m, dPos, left);
				}
				move(cPath, m, dPos, right);
				move(cPath, m, dPos, down);
				// System.out.println(addPontier + ", "+removePointer);
			}

			System.out.println("tital time: " + (new Date().getTime() - start.getTime()));

			System.out.println(min[N - 1][N - 1]);
		}

	}

	static void move(Path cPath, int[][] m, int[] dPos, int direction) {

		int[] move = new int[2];

		switch (direction) {
		case up:
			move = goUp(cPath.currentPos, m);
			break;
		case left:
			move = goLeft(cPath.currentPos, m);
			break;
		case right:
			move = goRight(cPath.currentPos, m);
			break;
		case down:
			move = goDown(cPath.currentPos, m);
			break;
		}

		if (move != null) {
			if (min[move[0]][move[1]] == -1 || min[move[0]][move[1]] > cPath.sum + m[move[0]][move[1]]) {
				Path copy = cPath.copy();
				copy.addStep(move, m);
				min[move[0]][move[1]] = copy.sum;
				if (move[0] != dPos[0] || move[1] != dPos[1]) {
					if (addPontier == list.length) {
						addPontier = 0;
					}
					list[addPontier] = copy;
					addPontier++;
				}
			}
		}
	}

	static void fillMatrix(String[] s, int[][] m) {

		int N = m.length;

		for (int j = 0; j < N; j++) {
			for (int k = 0; k < N; k++) {
				m[j][k] = Integer.parseInt(s[j * N + k]);
			}
		}
	}

	static int[] goLeft(int[] pos, int[][] m) {
		if (pos[1] > 0) {
			int leftPos = pos[1] - 1;
			return new int[] { pos[0], leftPos };
		}
		return null;
	}

	static int[] goRight(int[] pos, int[][] m) {
		if (pos[1] < m.length - 1) {
			int rightPos = pos[1] + 1;
			return new int[] { pos[0], rightPos };
		}
		return null;
	}

	static int[] goUp(int[] pos, int[][] m) {
		if (pos[0] > 0) {
			int upPos = pos[0] - 1;
			return new int[] { upPos, pos[1] };
		}
		return null;
	}

	static int[] goDown(int pos[], int[][] m) {
		if (pos[0] < m.length - 1) {
			int downPos = pos[0] + 1;
			return new int[] { downPos, pos[1] };
		}
		return null;
	}

}

class Path {
	int sum = 0;
	int[] currentPos = new int[2];

	void addStep(int[] pos, int[][] m) {
		currentPos = new int[] { pos[0], pos[1] };
		sum += m[currentPos[0]][currentPos[1]];
	}

	Path copy() {
		Path copy = new Path();
		copy.currentPos = currentPos;
		copy.sum = sum;
		return copy;
	}

	@Override
	public String toString() {
		return "" + sum;
	}
}
